export const SET_ID = 'set id';
export const SET_USERNAME = 'set username';

export const setUserId = (id) => {
  return {
    type: SET_ID,
    payload: id
  }
}

export const setUsername = (username) => {
  return {
    type: SET_USERNAME,
    payload: username
  }
}
